import BusinessObject from "./BusinessObject";

export default class User extends BusinessObject{

	constructor(aname, aage){
		super();
        this.name = aname
        this.age = aage	
    }

		getID() {
			return this.id;
		}

		setID(aId) {
		this.id = aId;
		}

    static fromJSON(user) {
		let results = null;
		if (Array.isArray(user)) {
			results = [];
			user.forEach((x) => {
				Object.setPrototypeOf(x, User.prototype);
				results.push(x);
			})
		} else {
			let x = user;
			Object.setPrototypeOf(x, User.prototype);
			results = x;
		}
		return results;
	}
}
